import Map from './Map'
import './App.css'
import Stores from './Stores'

class App extends Component {

  componentDidMount() {
    fetch(Stores)
    .then(res => res.json())
    .then()
    // .then(store => this.setState({ pokemonCollection: pokemonCollection }))
    .catch(e => console.error(e))
  }

  render() {
    return (
      <div className="App">
        <Map />
      </div>
    )
  }
}

export default App
